package ghidra.pcode.utils;
public class AddressUtils {
public static int unsignedCompare( long v1, long v2 ) {
if ( v1 == v2 ) {
return 0;
}
if ( v1 >= 0 && v2 >= 0 ) {
return v1 < v2 ? -1 : 1;
}
if ( v1 < 0 && v2 < 0 ) {
return v1 < v2 ? -1 : 1;
}
if ( v1 < 0 ) {
return 1;
}
return -1;
}
public static long unsignedSubtract( long a, long b ) {
return a - b;
}
public static long unsignedAdd( long a, long b ) {
return a + b;
}
}

