package bitmanipulation;
public class Leetcode268MissingNumber {
public int missingNumber(int[] nums) {
int sum = 0;
int all = 0;
for (int i = 0; i <= nums.length - 1; i++) {
sum += nums[i];
all += i;
}
all += nums.length;
return all - sum;
}
public int missingNumber2(int[] nums) {
int x = 0;
for (int i = 0; i <= nums.length - 1; i++) {
x ^= nums[i];
x ^= i;
}
x ^= nums.length;
return x;
}
}

