public int triangularNumbersInt(int n){
if (n <= 0){
return 0;
}
return n + triangularNumbersInt(n-1);
}
public long triangularNumbersLong(long l){
if (l <=  0){
return 0;
}
return l + triangularNumbersLong(l-1);
}
}

