package utils;
public class SequentialGenerator extends NumberGenerator {
private final int start;
private final int end;
private int next;
public SequentialGenerator(int start, int end) {
this.start = start;
this.end = end;
next = start;
}
@Override
public synchronized int sample() {
int result = next;
next++;
if (next > end)
next = start;
return result;
}
}

